import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Google from "./Googleoogle";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/google" element={<Google />} />
      </Routes>
    </Router>
  );
}

export default App;
